    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col0 IN ( - - col2, col2, 63 * + - col2 * col2 * col1 );
  - name: tab0

outputs:
  - name: q2191.out
    data: |
      15	81	47
      87	21	10
      97	1	99
